import React from "react";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from "react-responsive-carousel";

import first_slide from "./slideshow/first_slide.png";
import second_slide from "./slideshow/second_slide.png";
import third_slide from "./slideshow/third_slide.png";

function Home() {
  return (
    <div class="carousel-wrapper">
      <Carousel infiniteLoop useKeyboardArrows autoPlay>
        <div>
          <img src={first_slide} alt="First slide" />
        </div>
        <div>
          <img src={second_slide} alt="First slide" />
        </div>
        <div>
          <img src={third_slide} alt="First slide" />
        </div>
      </Carousel>
    </div>
  );
}
export default Home;
